pragma solidity ^0.5.1;

import "./DefaToken.sol";

contract DefaTokenSale{
    address payable admin;
    DefaToken public tokenContract;
    uint256 public tokenPrice;
    uint256 public tokensSold = 0;
    event Sell(address _buyer, uint256 _amount);

    constructor(DefaToken _tokenContract, uint256 _tokenPrice) public {
        admin = msg.sender;
        tokenContract = _tokenContract;
        tokenPrice = _tokenPrice;
    }

    function multiply(uint x,uint y) internal pure returns (uint z){
        require(y==0 || ((z = x * y)/y) == x, "Math not working - revert");
    }

    function buyTokens(uint256 _numberOfTokens) public payable {
        require(msg.value == multiply(_numberOfTokens, tokenPrice),"Token Value not the same - revert");
        require(tokenContract.balanceOf(address(this)) >= _numberOfTokens, "Tokens Exceed Available Balance - revert");
        require(tokenContract.transfer(msg.sender,_numberOfTokens),"Transfer insuccessful - revert");
        tokensSold += _numberOfTokens;
        emit Sell(msg.sender, _numberOfTokens);
    }
    function endSale() public{
        //Require Admin Defa
        require(msg.sender == admin,"Only Defa can end sale");
        require(tokenContract.transfer(admin, tokenContract.balanceOf(address(this))), "Transfer incomplete - revert");
        selfdestruct(admin);
    }

}
